INSERT INTO `textcomponent` (`idText`, `content`, `orderValue`, `idEvenement`, `idPeriode`) VALUES
(4, 'Pierre-Denis Martin, dit « Martin le Jeune » (né à Paris, vers 1663, et mort dans la même ville en 1742), fut, sous le règne de Louis XIV, pourvu de pensions et de la charge de « peintre ordinaire du roi ». À ce titre, il peignit nombre de tableaux pour orner les châteaux royaux de Versailles, Choisy et Compiègne (scènes de chasse, vues en perspective des villes, des domaines princiers). Il est évident que les cérémonies du sacre de Louis XV, en octobre 1722, dont il est le témoin actif, inaugurent une nouvelle étape de son œuvre et une forme de consécration personnelle, si besoin en était.', 1, 39, NULL),
(5, 'Si le souci de témoigner est si grand et la commande officielle si évidente (il faut établir aux yeux de tous la surpuissance mystérieuse d’un roi élu du ciel, investi d’une force invincible et miraculeuse), c’est que, plus que tout autre cérémonial d’État, le sacre est essentiel dans la religion royale. Malgré l’instantanéité de la succession conférée par l’hérédité – « le roi est mort, vive le roi » –, seule cette cérémonie fondatrice confère au souverain la totalité de son pouvoir et de sa puissance. L’affaire est d’importance dans le cas des héritiers mineurs : Louis XV n’a que cinq ans en 1715, lorsque meurt Louis XIV, et il est confié aux soins de son grand-oncle, le duc d’Orléans, « régent du royaume » jusqu’au 15 février 1723. Le sacre précède de quelques mois l’entrée en fonction du jeune prince.', 2, 39, NULL),
(6, 'Célébré à Reims, il se déroule en plusieurs temps, sur plusieurs jours : une nuit de recueillement, un jour de solennités (serments, messes, intronisation, sainte onction, hommages), le tout mêlant rites de chevalerie et cérémoniel catholique. C’est en « Roi Très-Chrétien », c’est-à-dire en défenseur universel de la foi, que Louis est couronné par douze pairs du royaume. Viennent ensuite le temps du festin puis, le lendemain ou le surlendemain, celui de la cavalcade, les deux moments clés retenus par l’artiste.', 3, 39, NULL),
(12, 'Tokugawa Ieyasu n\'était pas un jeune homme lorsqu\'il est devenu shogun en 1603. Son ascension au pouvoir a été lente, un voyage qui avait commencé alors qu\'il n\'avait que 15 ans. Grâce à un mélange de chance, de stratégie, de patience et de sagesse, il a survécu à la fin turbulente de la période médiévale Sengoku (« Âge des provinces en guerre ») du Japon et a pris le contrôle du pays à l\'âge de 60 ans. À sa mort en 1616, il laisse une nation transformée et une dynastie décidée à rester au pouvoir.', 1, 48, NULL),
(13, 'Au 17e siècle, le chef d\'État officiel du Japon était l\'empereur, dont le siège se trouvait à Kyoto. Le shogun de l\'empereur était le commandant militaire, un dirigeant de fait craint et respecté par tous. Le titre de shogun est une adaptation du terme seii taishogun, qui signifie « commandant suprême qui soumet les barbares ». Le shogun était officiellement nommé par l\'empereur, mais celui-ci pouvait former des dynasties héréditaires qui se transmettaient le pouvoir de shogun d\'une génération à l\'autre.', 2, 48, NULL),
(14, 'Tokugawa Ieyasu n\'a pas dérogé à la règle ; il a pris des mesures et mis en œuvre des politiques pendant son règne qui ont permis à sa famille de contrôler le Japon longtemps après sa mort. Ses descendants ont continué à gouverner le Japon pendant plus de 250 ans.', 3, 48, NULL);

